import productsData from "../../../data.js";
import MostPopularCard from "../../MostPopularCard/MostPopularCard.jsx";
import "./MostPopular.css";

const MostPopular = () => {
  return (
    <div style={{ color: "#fff" }} className="main-most-popular">
    <div>
        <p>
        Most Popular 
        </p>
    </div>
      <div className="row">
        {productsData.map((items) => {
          return (
            <div className="col-3">
              <MostPopularCard image={items.image} />
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default MostPopular;
